import React from "react";
import axios from "axios"; 

class Result extends React.Component {
    constructor(props) {
        super(props); 
    }

    async componentDidMount() {
        try {
            const res = await axios.get("/api/matched");
            console.log(res)
            this.setState({
                matchedjobs: res.data, 
            })
            console.log(this.state.matchedjobs)
        } catch(error){
            console.log(error)
        }
    }
    render() {
        return (
            <div>
            </div>
        )
    }
}

export default Result; 

